import React from 'react';
import {Grid} from '@material-ui/core';
import randomColor from 'randomcolor';

const RepoPage = () => {
  return (
    <div className="RepoPage_GridA1">
      <Grid container style={{background:randomColor({hue:'blue'})}}>
        <Grid style={{background:randomColor({hue:'green'})}}>
          Hooray nothing is here!
        </Grid>
      </Grid>
    </div>
  );
};



export default RepoPage;
